    "\n",
    "### **Introduction**  \n",
    "\n",
    "The bike-share company **Cyclistic**, based in Chicago, wants to analyze how casual riders and annual members use Cyclistic bikes differently. This insight can be provided information to design a marketing strategy to increase the annual memberships. \n",
    "\n",
    "* **Casual riders** *are customers who purchase single-ride or full-day passes.*\n",
    "* **Member riders** *are customers who purchase annual memberships*.\n",
    "\n",
    "### **Characters and teams**\n",
    "\n",
    "* **Lily Moreno:** The director and manager. She is responsible  for the development of campaigns and initiatives to promote be bike-share program. These may include email,social media, and other channels.\n",
    "* **Cyclistic marketing analytics team:** A team data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic markeing strategy.\n",
    "\n",
    "\n",
    "\n"
   ]
  },
