   "source": [
    "#Let's create a visualization average duration by hours\n",
    "all_trips_v2%>%\n",
    " mutate(hours = hour(started_at)) %>%\n",
    " group_by(member_casual,hours)%>%\n",
    " summarise( number_of_rides =n(),\n",
    "          average_duration = mean(ride_length)\n",
    "          )%>%\n",
    " arrange(member_casual,hours) %>%\n",
    " ggplot(aes(x=hours,y=average_duration,fill=member_casual)) +\n",
    " geom_col(position=\"dodge\") +\n",
    " labs(title= \"Number of rides by month\",x=\"Hours\",y=\"Average duration\",fill= \"User type\")"
   ]
