   "source": [
    "#Let's create a visualization number of rides by month\n",
    "all_trips_v2%>%\n",
    " mutate(months = months(started_at,abbreviate=FALSE)) %>%\n",
    " group_by(member_casual,month)%>%\n",
    " summarise( number_of_rides =n(),\n",
    "          average_duration = mean(ride_length)\n",
    "          )%>%\n",
    " arrange(member_casual,month) %>%\n",
    " ggplot(aes(x=month,y=number_of_rides,fill=member_casual)) +\n",
    " geom_col(position=\"dodge\") +\n",
    " labs(title= \"Number of rides by month\",x=\"Month\",y=\"Number of rides\",fill= \"User type\")\n"
   ]
