   "source": [
    "#### *Key Takeways*\n",
    "\n",
    "* Trip duration throughout the week : the trip duration for Casual riders was more than double of the trip duration for Member riders during weekends. Member Riders' usage remain consistent over the week.\n",
    "\n",
    "* Number of rides throughout the week : the number of rides for Member riders was more than the number of rides for Casual riders\n",
    "\n",
    "* During the hours of 8 a.m - 9 a.m and 6:00 pm - 7:00 pm the member rides use service the most during a day. At 5:00 - 6:00 pm The Casual riders often use service the most during the day\n",
    "\n",
    "* Trip duration over the Year “Monthly” : Casual riders usage peaks in the summer months while drop off significantly in the winter, Member Riders usage peaks in the summer months and start to decreases gradually in the winter months.\n",
    "\n",
    "* The most frequently used station by casual riders is at \"Streeter Dr & Grand Ave\" and by member riders is at \"Canal St & Adam St\"  "
   ]
