    "#### *Conclusions*\n",
    "\n",
    "* Casual Riders' patterns show that most of casual riders use the service for recreation or fitness purposes after work hours and in the weekends\n",
    "\n",
    "* Member Riders' patterns show that a significant number of members use the service for commuting to work or school"
