   "source": [
    "#### *Recommendations*\n",
    "\n",
    "* The best times of the year to start marketing campaigns are in the spring, summer and fall months. \n",
    "\n",
    "* The best day of the week to start marketing campaigns are weekends. That is when there is peak usuage in casual riders.\n",
    "\n",
    "* Employing demand-based pricing in which members receive a price reduction or credit for parking bicycles at empty docking locations. Create a reward program to encourage users to move bikes from “typically full” stations to “typically empty” stations during the weekday morning rush hours!\n",
    "\n",
    "* Offering newer technological innovations such as checking bicycle or parking availability via text message, website or smartphone app will attract more users\n",
    "\n",
    "* The campaign should target riders with families, young riders and riders who want to exercise. And since annual memberships are usually taken by people commuting to work, the campaigns should also target companies in Chicago so their employees can get a group membership to travel to work using bike share.\n",
    "\n",
    "* To encourage annual memberships, the membership programs must be flexible and offer short- and long-term memberships in addition to one-time usage fees and users should be able to sign up for membership online or at the station. Other attractive special privileges and perks should be granted to annual members which will also attract more memberships.\n"
   ]
